### Solution:

The easiest thing to do with this problem is to look at the element which is higher than 20. If it is the last element in the array, we'll add asterisk to the tail element.

So given `[7, 2, "50", 1]`, the result will become `[7, 2*, "50", 50, 1]`, and `[6, "39", 1, 1]` will result in `[39, 39*, 1, 1]`.

```
function has(number){
    return array.find((element)=>element>number)
}

let has20 = (array) => {
    return array.filter(e=> e > 20).map((v) => {
        if(v == array[array.length-1])
            return v + "*";
        return v;
    })
}
```


